import React, {useState} from "react"
import {useHistory} from "react-router-dom"
import Button from "react-bootstrap/Button"

export default function History(){
    //gallons, delivery addreess, delivery datae, price/gallon, amount due
    var rows = useState(['row1', 'row 2'])

    function addRow(){
        var rows = rows.push('new row')
        this.setState({rows: rows})
    }
    return(
        <div>
            <table>
                {rows.map((r) => (
                    <label>
                        {r}
                    </label>
                ))}
            </table>
        </div>
    )
}
